sotGrp_PROGRAM=プログラムグループには、小さなプログラム関連のヘッダーファイル、ソースコード、ドキュメントが含まれています
sotGrp_VARS=変数グループには、アプレットで定義されたシステムレベルの変数が含まれます。外部インターフェイスと対話できます。<br>フローティングポイント "V1"変数を定義した後、次の操作を変数に使用できます：<br> [1 ]変数値を読む：double d
sotGrp_TIMERS=タイマーグループには、アプレットで定義されているすべてのタイマーが含まれています。次の例を使用してタイマーを使用します。<br> [1]このグループのタイマーを定義します。たとえば、「tim1」<br> [2] 10 ms <br> [3]などのこのタイマーのサイクルを設定します。 「イベントのタイマー」では、グループは「ONTIM1」などのタイマーコールバック関数を定義し、タイマーをコード（）; BR> [5]先に定義されたタイマーコールバック関数「ONTIM1」は、サイクルコールとして10ミリ秒と呼ばれます
sotGrp_ON_CAN_RXS=缶受信イベントグループには、定義されたすべての缶 /缶fdパケット受信回復機能が含まれています。ユースバックメソッドは次のとおりです。<br> [1]コールバック関数名「ONRX123」を定義し、その属性バインディングロゴ「0x123」を定義します。これは、IDがIDから受信されることを意味します。
sotGrp_ON_CAN_TXS=CAN送信イベントグループには、すべての定義されたCAN / CAN FDパケットが含まれており、リカバリ機能を成功させることができます。 <br>注：成功したメッセージを送信することでのみ（他のノードで正常に応答します）このコールバックを入力します。<br> TSMasterでサポートされているハードウェアの中で、他のブランドを使用するときにハードウェアタイムスタンプを受信するために正しいパケットを生成する機能があります<br>ハードウェアの妥協として、送信後に成功したかどうかに関係なく、これは強制的に呼び出されます。 <br>ユースバックメソッドは次のとおりです。<br> [1]コールバック関数名 "ontx123"を定義し、その属性バインディングロゴ "0x123"、<br>
sotGrp_ON_CAN_PRETXS=缶入りのイベントグループには、以前のコールバック関数を送信する前に、定義されたすべての缶 / CAN FDパケットが含まれています。 <br>注：この関数はTSMasterに固有のものであり、システムがパケットの各フレームをエミストすることは、そのような関数によってリンクできます。 <br>パケットまたはフレームタイプの内容を変更する場合、この関数を使用すると非常に役立ちます。 <br>この関数の介入は非常に高いため、使用時にデータを特定して保護することに注意してください。 <br>ユースバックメソッドは次のとおりです。<br> [1]コールバック関数名「onpretx123」、その属性バインディングロゴ「0x123」、<br> 。
sotGrp_ON_LIN_RXS=LINレシーブイベントグループには、定義されたすべてのLINパケットレシーブ回復機能が含まれています。ユースバックメソッドは次のとおりです。<br> [1]コールバック関数名「ONRX12」とその属性バインディングロゴ「0x12」を定義します。
sotGrp_ON_LIN_TXS=LIN送信イベントグループには、定義されたすべてのLINパケットの成功したコールバック関数が含まれています。 <br>ユースバックメソッドは次のとおりです。<br> [1]コールバック関数名「ONTX12」とその属性バインディングロゴ「0x12」を定義します。
sotGrp_ON_LIN_PRETXS=LIN PRE発行イベントグループには、バックバック関数を送信する前に、定義されたすべてのLINメッセージが含まれています。 <br>注：この関数はTSMasterに固有のものであり、システムからのパケットの各フレームはそのような関数にリンクできます。 <br>パケットまたはフレームタイプの内容を変更する場合、この関数を使用すると非常に役立ちます。 <br>この関数の介入は非常に高いため、使用時にデータを特定して保護することに注意してください。 <br>ユースバックメソッドは次のとおりです。<br> [1]コールバック関数「onpretx12」を定義し、その属性バインディングロゴ「0x12」、<br>
sotGrp_ON_VAR_CHANGES=変数変更イベントグループには、定義されたすべての変数変更関数が含まれています。たとえば、変数の「V1」メソッドエッセンスによって変更された後、 <br>このコールバック関数を使用すると、メソッドは次のとおりです。<br> [1]ツリーの左ツリービューの「変数」領域は、この地区の「V1」<br> [2]などの変数を示しています。変数変更イベントの宣言<br <br <br> [3]は、このイベントの「変数」属性を「V1」<br> [4]に関連付けました。権利。
sotGrp_ON_TIMERS=タイマーイベントグループには、定義されたすべてのタイマーコールバック関数が含まれています。 <br>タイマーコールバック関数を使用し、次の例を参照してください。<br> [1]左側の「タイマー」グループの「tim1」<br> [2]などのタイマーを10ms、つまり、 2秒で100回オーバーフロー<br> [3]このグループのタイマーコールバック関数「ONTIM1」を定義し、「tim1.start（）;」の前に定義されたタイマーに関連付けます。以前に定義された関数「ONTIM1」
sotGrp_ON_STARTS=Startup Event Groupには、定義されたすべてのスクリプト開始関数が含まれています。 <br>複数のスタートアップコールバックが定義されている場合、システムはこれらのコールバック関数を順序で実行します。 <br>注：start -upリカバリ関数では、タイミングイベントやパケットバックイベントなどのイベントがトリガーされません。 <br>使い捨て自動化テストを実行する場合は、テストコードをステップ関数に移動し、最後にステップ関数の最後に「app.termiinate_application（）」を呼び出します。
sotGrp_ON_STOPS=STOPイベントグループには、定義されたすべてのスクリプトSTOPコールバック関数が含まれています。 <br>複数のストップコールバックが定義されている場合、システムはこれらのコールバック関数を順序で実行します。 <br>注：コールバック関数を停止すると、タイミングイベントやパケットバックイベントなどのイベントはトリガーされません。
sotGrp_ON_SHORTCUTS=ショートカットキーには、定義されたすべてのキーイベントコールバック関数が含まれています<br>キーイベントを使用する方法は次のとおりです。<br> [1]「onkeya」などのキーイベントを定義します。キーボードの「A」キーは、このイベントをAキーに関連付けます<br> [3]イベント回復関数の処理コードを書き留めてから、各プログラムが開始された後、プレスを押し、毎回押す、プレス、プレス、プレスを押します、プレス、プレス、プレス、プレスを押して、プログラムを押します。キーは書かれたコードをトリガーします
sotGrp_FUNCS=カスタム関数グループには、すべてのユーザー定義関数のカスタムが含まれています。<br>カスタム関数を使用して次の例を参照してください。 [2]関数属性の2つのパラメーターを設定します。たとえば、「const s32 a、const s32 b」[3]他の部分の「return a + b;」<br> [4]など、関数本文にアルゴリズムを書きます。コードのコードの場合、「r」と呼びます
sotItm_ALL_SRC=このノードには、このアプレットの最終ソースコードが含まれています。 <br>このソースコードは読み取りのみです。コンパイルプロセスにエラーがある場合、このファイルにエラーラインを配置できます。 <br>コンピレーションエラーの問題を解決するには、最初にこのファイルを開いてエラーコンテキストを確認し、<br>を確認し、対応するイベント処理関数に切り替えてエラーを修正し、それらをもう一度コンパイルしようとします。
sotItm_GLOBAL_DEF=このノードには、「#include <xxx>」、「s32 vvar1;」など、コード全体の前面に表示されるすべてのグローバル変数と宣言が含まれています。
sotItm_TSMASTER_HEADER=このノードには、TSMasterアプレット、ステートメント、およびその他のコンテンツ<br>のすべてのマクロ定義がこのヘッダーファイルを介して、「TCAN」、「PCAN」など、アプレット内のさまざまなシンボルの定義コンテンツを見つけることができます。
sotItm_STEP_FUNC=ステップ関数は、ECUノードのサイクルタスクをシミュレートします。ECUノードは、システムの周期的に呼び出すことができます。
sotItm_DB_HEADER=このノードには、ロードされたDBCまたはLDFファイルで定義されたすべてのパネルと信号が含まれています。<br>データベースを操作する缶を例として使用すると、次の手順を実行できます。特定のTSMasterロードの特定のDBCファイルの特定の読み込み<br> [2]このノードに目を向けると、すべてのメッセージと信号のすべてのCコード定義が生成されていることがわかります<br> [3]「関数」ページに転換します右側には、下のデータベースにメッセージが表示されます[br> [4]右 - 「configure_1」などのメッセージの任意のフレームをクリックし、「スクリプトに追加」<br>を選択します。現在のスクリプトへのこのメッセージ "" "チャンネル1のステートメントを構成する例：<br> tconfigure_1 configure_1; <br> configure_1.init（）; <br> [5]コードの最後の行" configure_1。 init（）; configure_1 "<br>の初期化関数この行コードを初めて「configure_1」を使用する必要がある場所に<br> [6]。信号「FL_SPEED」：結果
sotItm_Documentation=このノードは、このアプレットのドキュメントテキストを書くことができます<br>このアプレットによって作成された次のドキュメントなど、このアプレットのアルゴリズムを説明および説明できます。 「プログラム名」<br> [2]このアプレットにイベントを追加するか、「ステップ関数」を直接変更します<br> [3] f9を押してコードを実行してコードを実行します
